import logo from './logo.svg';
import './App.css';

const App = () => {
	return (
		<div className='app-wrapper'>
			<header className='header'>
				<img src='https://download.blender.org/branding/community/blender_community_badge_black.png' />
			</header>

			<nav className='menu'>
				Navigation
			</nav>

			<section className='content'>
				page content
			</section>
		</div>
	)
}



export default App;
